    <div id="tooltip" style="position: absolute; display: none; background: white; padding: 5px; border: 1px solid #ccc;"></div>




    <script>
        const polygon = document.getElementById("myPolygon");
        const tooltip = document.getElementById("tooltip");

        polygon.addEventListener("mouseenter", function () {
            const title = polygon.getAttribute("xlink:title");
            if (title) {
                tooltip.style.display = "block";
                tooltip.textContent = title;
            }
        });

        polygon.addEventListener("mousemove", function (e) {
            if (tooltip.style.display === "block") {
                tooltip.style.left = e.pageX + "px";
                tooltip.style.top = e.pageY + "px";
            }
        });

        polygon.addEventListener("mouseleave", function () {
            tooltip.style.display = "none";
        });

        function getBrgyData() {
            console.log("testing");
            fetch('getBrgyData.php', {
                    method: 'READ',
                    headers: {
                        'Content-Type': 'application/json'
                    },
                    body: JSON.stringify({ id: brgyId })
            })
            .then(response => response.json())
            .then(data => {
                // Handle the retrieved data here
                if (data.skills) {
                    // Access the admin's name and email
                    const adminName = data.name;
                    const adminEmail = data.email;
                    document.getElementById("editAdminName").value = `${adminName}`;
                    document.getElementById("editAdminEmail").value = `${adminEmail}`;
                    console.log(`Admin Name: ${adminName}`);
                    console.log(`Admin Email: ${adminEmail}`);
                } else {
                    console.error('Error: Invalid data received from the server.');
                }
            })
            .catch(error => {
                console.error('Error:', error);
            });
        }
    
    </script>

